import React, { Component } from 'react';
import Box from './Box'

export default class Col extends React.Component{
    constructor(props){
        super(props);
    }

    render(){
        return(
            <div 
                id={this.props.box.id}
                className={"Col"} >
                    cisos
            </div>
        );
    }
}
